import React from 'react';
import ReactDOM from 'react-dom';

class Determination extends React.Component{
    constructor(props)
    {
      super(props);
      this.state =
      {
      score: "40"
      }
    }
    render(){
      return <ExamChecker score={this.state.score}/>
    }
}


const ExamChecker = (props) =>{
  if(Number(props.score)<30){
    return <h1>Faild</h1>;
  }
  return <h1>Passed!</h1>;
}
ReactDOM.render(
          <Determination/>,
          document.getElementById('root')
          );
